let arr =
  "";
function splitarr() {
  arr = arr.split("");
  return arr;
}

splitarr();

let answer = 0;

for (let i = 0; i < arr.length; i++) {
  if (
    arr[i] !== arr[i + 1] &&
    arr[i] !== arr[i + 2] &&
    arr[i] !== arr[i + 3] &&
    arr[i + 1] !== arr[i + 2] &&
    arr[i + 1] !== arr[i + 3] &&
    arr[i + 2] !== arr[i + 3]
  ) {
    if (answer === 0) {
      answer = i + 4;
    }
  }
}
console.log("Answer6 part 1: " + answer);

let pff = [];
for (let i = 0; i < arr.length; i++) {
  let arr14 = arr.slice(i, i + 14);
  //console.log(arr14)

  for (let j = 0; j < arr14.length; j++) {
    for (let k = j + 1; k < arr14.length; k++) {
      if (arr14[j] === arr14[k] && !pff.includes(i)) {
        pff.push(i);
      }
    }
  }
}

//console.log(pff);

for (let i = 0; i < 3600; i++) {
  if (pff[i] !== i) {
    console.log("Answer6 part 2: " + (i + 14));
    break;
  }
}
